import React from 'react';
import './App.css';
import Header from './header'
import NestedGrid from './nestedGrid'
import Grid from '@material-ui/core'

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Grid container xs={12} direction ="row" alignItems="Center">
        <Grid item xs={9}>
          <NestedGrid></NestedGrid>
        </Grid>
        <Grid item xs={3}>

        </Grid>
      </Grid> 


    </div>
  );
}

export default App;
